package mil.nga.giat.mage.map.cache;

public class CacheImportException extends Exception {

    public CacheImportException() {
    }

    public CacheImportException(String message) {
        super(message);
    }

    public CacheImportException(String message, Throwable cause) {
        super(message, cause);
    }

    public CacheImportException(Throwable cause) {
        super(cause);
    }
}
